import React from 'react';
import { List, Card } from 'antd';
import styled from 'styled-components';

const SkillList = styled.div``;

const Skill = () => {
  const data = [
    {
      title: 'React.js',
      img: 'react',
    },
    {
      title: 'Javascript',
      img: 'javascript.png',
    },
    {
      title: 'CSS',
      img: '',
    },
    {
      title: 'Sass',
      img: '',
    },
    {
      title: 'Git',
      img: '',
    },
    {
      title: 'node.js',
      img: '',
    },
    {
      title: 'Express',
      img: '',
    },
    {
      title: 'Jquery',
      img: '',
    },
    {
      title: 'MySQL',
      img: '',
    },
    {
      title: 'Azure',
      img: '',
    },
  ];

  return (
    <SkillList>
      <List
        grid={{ gutter: 16, column: 5 }}
        dataSource={data}
        renderItem={(item) => (
          <List.Item>
            <Card title={item.title}>
              <img src={`require('../img/${item.img}')`} />
            </Card>
          </List.Item>
        )}
      />
      ,
    </SkillList>
  );
};

export default Skill;
